import React, { Component } from 'react';

import './styles.css';

import hamburguer from '../../img/hamburguer.png'
import home from '../../img/house_home_13944.png'

export default class Header extends Component{
	constructor(props) {
		super(props);
		state = {
			isOpen: true
		};
		this.handleClick = this.handleClick.bind(this);
	}

	handleClick() {
		this.setState = ({isOpen: false});
		console.log(this.state.isOpen);
	};

	render() {
		// const { isOpen } = this.state;

		return (
			<header className="header">
				<a onClick={this.handleClick}><img src={hamburguer} alt="Ícone Menu Hamburguer" title="Ícone Menu Hamburguer"></img></a>
				<nav>
					<a href="home.html"><img src={home} alt="Ícone Home" title="Ícone Home"></img></a>
					<ul>
						<li><a href="sobre.html">Sobre mim</a></li>
						<li><a href="portfolio.html">Portfolio</a></li>
						<li><a href="contato.html">Contato</a></li>
						<li><a href="blog.html">Blog</a></li>
					</ul>
				</nav>
			</header>
		);
	}
};
